import React from "react";
import Cart from "../Cart";
import Frame3593 from "../Frame3593";
import Person from "../Person";
import "./Component1.css";

function Component1(props) {
  const {
    vector,
    vector2,
    vector3,
    vector4,
    vector5,
    vector6,
    text8,
    text17,
    text18,
    cartProps,
    frame3593Props,
    personProps,
  } = props;

  return (
    <div className="component-1">
      <div className="overlap-group">
        <div className="frame-1945">
          <div className="overlap-group1">
            <div className="frame-3596">
              <div className="frame">
                <img className="vector" src={vector} />
                <img className="vector-1" src={vector2} />
                <img className="vector-3" src={vector3} />
                <img className="vector-3" src={vector4} />
                <img className="vector-3" src={vector5} />
                <img className="vector-3" src={vector6} />
              </div>
              <div className="text-8 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text8}</div>
            </div>
            <div className="rectangle-859"></div>
          </div>
        </div>
        <div className="frame-3500">
          <Cart
            vector2={cartProps.vector2}
            vector1={cartProps.vector1}
            vector6={cartProps.vector6}
            vector7={cartProps.vector7}
          />
          <div className="text-17 ibmplexsans-semi-bold-shark-16px">{text17}</div>
        </div>
        <div className="rectangle-859-1"></div>
      </div>
      <Frame3593 text16={frame3593Props.text16} editList_ulProps={frame3593Props.editList_ulProps} />
      <div className="frame-3594">
        <Person vector={personProps.vector} vector2={personProps.vector2} vector3={personProps.vector3} />
        <div className="text-18 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text18}</div>
      </div>
    </div>
  );
}

export default Component1;
